#[derive(Derivative)]
#[derivative(Default(bound=""))]
pub enum Option {
    #[derivative(Default)]
    /// No value
    None,
    /// Some value `T`
    Some(T),
}

pub enum Option {
    /// No value
    None,
    /// Some value `T`
    Some(T),
}

impl Default for Option {
    /// Returns None.
    #[inline]
    fn default() -> Option {
        None
    }
}




